import React ,{Component} from 'react';
import './App.css';

class App extends Component {
  getUser (username){
    fetch('https://api.github.com/users/${username}')
    .then(respons)
  }
  render(){
    return (
      <div className="App">
       <form onSubmit={e=>this.handleSubmit(e)}>
         <input ref='username' type='text' placeholder='username'></input>
       </form>
      </div>
    );
  }

}

export default App;
